Located about 35 km northeast of the city of Puri on the coastline in the state of Odisha (earlier Orissa). It was built by King Narasimhadeva I.

The temple in its present state was declared as best-known tourist destination in Orissa and also has been a World Heritage Site since 1984.

Konarak stands as a classic example of Hindu temple architecture, complete with a colossal structure, sculptures and artwork on myriad themes.

The word 'Konark' is a combination of two Sanskrit words kona (corner or angle) and arka (the sun). It thus implies that the main deity was the sun god, and the temple was built in an angular format.

Swipe â¡ï¸ to see the wheels of Konark temple-

There are two rows of 12 wheels on each side of the Konark sun temple. Some say the wheels represent the 24 hours in a day and others say the 12 months. 
The seven horses are said to symbolize the seven days of the week. 
Sailors once called this Sun Temple of Konarak, the Black Pagoda because it was supposed to draw ships into the shore and cause shipwrecks.

Swipe next â¡ï¸ to know more

The temple is replete with couples engaged in intense varying positions. 
The flexibility of the muscles of the body of both the man and wife engaged in coitus is proof of the fact that the knowledge of human anatomy and its prospects were not an unexplored subject in 13th century AD.
Of the 24 wheels, there are eight night wheels that depict eight sexual postures, each different from the other.

In all, there are 84 sexual stances in varying permutations and combinations. 
The portrayal of such structural design was a method of satisfying their carnal desire.

